import React, { useState } from 'react';
import './AppointmentForm.css'; 
import img from '../Asset/appointment1.jpg';

function AppointmentForm() {
  const [date, setDate] = useState('');
  const [time, setTime] = useState('');
  const [patientName, setPatientName] = useState('');
  const [selectedOption, setSelectedOption] = useState('');
  const [age, setAge]=useState('');
  const [selectedGender, setSelectedGender] = useState('');
  const [mobileNumber, setMobileNumber] = useState('');


  const handleFormSubmit = (event) => {
    event.preventDefault();
    console.log('Appointment details submitted:', { date, time, patientName });
  };

  return (
    <>
    <div className="appointment-form justify-around">
      <h2>Schedule an Appointment</h2>
      <div className='media'>
      <figure>
            <img src={img} alt="" className=' h-70 mr-3' />
        </figure>
      </div>

      <form onSubmit={handleFormSubmit}>
        <div>
          <label>Date:</label>
          <input
            type="date"
            value={date}
            onChange={(e) => setDate(e.target.value)}
            required
          />
        </div>

        <div>
          <label>Time:</label>
          <input
            type="time"
            value={time}
            onChange={(e) => setTime(e.target.value)}
            required
          />
        </div>

        <div>
           <label>Doctor Name :</label>
           <select
            value={selectedOption}
            onChange={(e)=> setSelectedOption(e.target.value)}
           >
            <option value="" disabled>
              Select a Doctor
            </option>
            <option value="bhatra">Dr. Gambhir Bhatra </option>
            <option value="sinha">Dr. Manoj Sinha </option>
            <option value="rao">Dr. Gaurav Rao</option>
           </select>
        </div>

        <div>
          <label>Patient Name:</label>
          <input
            type="text"
            value={patientName}
            onChange={(e) => setPatientName(e.target.value)}
            required
            placeholder='Enter your Name '
          />
        </div>

        <div>
          <label>Age:</label>
          <input
            type="number"
            value={age}
            onChange={(e) => setAge(e.target.value)}
            required
            placeholder='Enter your Age'
          />
        </div>

        <div>
          <label>Gender:</label>
          <select
            value={selectedGender}
            onChange={(e) => setSelectedGender(e.target.value)}
            required
          >
            <option value="" disabled>
              Select gender
            </option>
            <option value="male">Male</option>
            <option value="female">Female</option>
            <option value="other">Other</option>
          </select>
        </div>

        <div>
          <label>Mobile Phone Number:</label>
          <input
            type="tel" 
            value={mobileNumber}
            onChange={(e) => setMobileNumber(e.target.value)}
            required
            placeholder="Enter your mobile number"
          />
        </div>

        <div>
          <button type="submit">Submit Appointment</button>
        </div>
      </form>
      </div>


      </>
  );
}

export default AppointmentForm;
